// flag-fetch      = flag / "\Recent"
// flag-keyword    = atom
// flag-list       = "(" [flag *(SP flag)] ")"
// flag-perm       = flag / "\*"
// greeting        = "*" SP (resp-cond-auth / resp-cond-bye) CRLF
// header-fld-name = astring
// header-list     = "(" header-fld-name *(SP header-fld-name) ")"
// list            = "LIST" SP mailbox SP list-mailbox
// list-mailbox    = 1*list-char / string
// list-char       = ATOM-CHAR / list-wildcards / resp-specials
// list-wildcards  = "%" / "*"
// 
// ; Number represents the number of CHAR8s
// ; original declaration was: literal         = "{" number "}" CRLF *CHAR8
// ; but in this naive form it is greedy and eats all intput so we use UDT
// literal         = "{" u_literal-size "}" CRLF u_literal-data
// 
// login           = "LOGIN" SP userid SP password
// lsub            = "LSUB" SP mailbox SP list-mailbox
// 
// mailbox         = "INBOX" / astring
//                     ; INBOX is case-insensitive.  All case variants of
//                     ; INBOX (e.g., "iNbOx") MUST be interpreted as INBOX
//                     ; not as an astring.  An astring which consists of
//                     ; the case-insensitive sequence "I" "N" "B" "O" "X"
//                     ; is considered to be INBOX and not an astring.
//                     ;  Refer to section 5.1 for further
//                     ; semantic details of mailbox names.
// mailbox-data-exists = number SP "EXISTS"
// mailbox-data-recent = number SP "RECENT"
// mailbox-data    =  "FLAGS" SP flag-list / "LIST" SP mailbox-list /
//                    "LSUB" SP mailbox-list / "SEARCH" *(SP nz-number) /
//                    "STATUS" SP mailbox SP "(" [status-att-list] ")" /
//                    mailbox-data-exists / mailbox-data-recent
// open-brace       = "("
// close-brace      = ")"
// mailbox-list    = open-brace [mbx-list-flags] close-brace SP
//                    (DQUOTE QUOTED-CHAR DQUOTE / nil) SP mailbox
// mbx-list-flags  = *(mbx-list-oflag SP) mbx-list-sflag *(SP mbx-list-oflag)
//                   / mbx-list-oflag *(SP mbx-list-oflag)
// mbx-list-oflag  = "\Noinferiors" / flag-extension
//                     ; Other flags; multiple possible per LIST response
// mbx-list-sflag  = "\Noselect" / "\Marked" / "\Unmarked"
//                     ; Selectability flags; only one per LIST response
// ; media-basic-type-tag-application = "APPLICATION"
// ; media-basic-type-tag-audio = "AUDIO"
// ; media-basic-type-tag-image = "IMAGE"
// ; media-basic-type-tag-message = "MESSAGE"
// ; media-basic-type-tag-video = "VIDEO"
// 
// ; media-basic     = ((DQUOTE (media-basic-type-tag-application / media-basic-type-tag-audio / media-basic-type-tag-image /
// ;                   media-basic-type-tag-message / media-basic-type-tag-video) DQUOTE) / string) SP
// ;                   media-subtype ; Defined in [MIME-IMT]
// media-basic-type-tag = string
// media-basic     = media-basic-type-tag SP media-subtype
// media-message   = DQUOTE "MESSAGE" DQUOTE SP DQUOTE "RFC822" DQUOTE ; Defined in [MIME-IMT]
// media-subtype   = string ; Defined in [MIME-IMT]
// media-text      = DQUOTE "TEXT" DQUOTE SP media-subtype ; Defined in [MIME-IMT]
// expunge-message-data = "EXPUNGE"
// fetch-message-data = "FETCH" SP msg-att
// message-data    = nz-number SP (expunge-message-data / fetch-message-data)
// msg-att         = "(" (msg-att-dynamic / msg-att-static)
//                    *(SP (msg-att-dynamic / msg-att-static)) ")"
// msg-att-dynamic = "FLAGS" SP "(" [flag-fetch *(SP flag-fetch)] ")" ; MAY change for a message
// msg-att-static-envelope = "ENVELOPE" SP envelope
// msg-att-static-uid = "UID" SP uniqueid
// msg-att-static-internaldate = "INTERNALDATE" SP date-time
// msg-att-static-body-structure = "BODY" ["STRUCTURE"] SP body
// msg-att-static-body-section = "BODY" section ["<" number ">"] SP nstring
// msg-att-static-rfc822 = "RFC822" [".HEADER" / ".TEXT"] SP nstring
// msg-att-static-rfc822-size = "RFC822.SIZE" SP number
// msg-att-static  = msg-att-static-envelope /
//                   msg-att-static-uid /
//                   msg-att-static-internaldate /
//                   msg-att-static-body-structure /
//                   msg-att-static-body-section /
//                   msg-att-static-rfc822 /
//                   msg-att-static-rfc822-size
