//                     ; MUST NOT change for a message
// nil             = "NIL"
// nstring         = string / nil
// number          = 1*DIGIT ; Unsigned 32-bit integer ; (0 <= n < 4,294,967,296)
// nz-number       = digit-nz *DIGIT ; Non-zero unsigned 32-bit integer ; (0 < n < 4,294,967,296)
