// OK = "OK"
// NO = "NO"
// BAD = "BAD"
// resp-cond-state = (OK / NO / BAD) SP resp-text ; Status condition
// resp-specials   = "]"
// resp-text       = ["[" resp-text-code "]" SP] text
// 
// ; ADDED: any TEXT-CHAR except "]"
// ANY-TEXT-CHAR-EXCEPT-SB    = %x1-9 / %xb-c / %xe-5c / %x5e-7f
// resp-text-code-alert = "ALERT"
// resp-text-code-permanent-flags = "PERMANENTFLAGS" SP "(" [flag-perm *(SP flag-perm)] ")"
// resp-text-code-uidvalidity = "UIDVALIDITY" SP nz-number
// resp-text-code-unseen = "UNSEEN" SP nz-number
// resp-text-code-uid-next = "UIDNEXT" SP nz-number
// resp-text-code-read-write = "READ-WRITE"
// resp-text-code-read-only = "READ-ONLY"
// resp-text-code-try-create = "TRYCREATE"
// resp-text-code  = resp-text-code-alert /
